const BASE_URL = "https://covid19.mathdro.id/api/"

const ENDPOINTS = {
    GLOBAL_COVID: `${BASE_URL}`,
    INDONESIA_COVID: `${BASE_URL}countries/indonesia`,
    SUMMARY_GLOBAL: `https://covid19.mathdro.id/api/og`,
    SUMMARY_GLOBAL: `https://covid19.mathdro.id/api/og`,
}

export default ENDPOINTS;
